const Modal = ({ data }) => {
    const onMouseMove = (e) => {
        this.setState({ x: e.nativeEvent.offsetX, y: e.nativeEvent.offsetY });
    }
    const {x, y} = this.state
    return(
        <div>
            <img onMouseMove={onMouseMove.bind(this)} src={data.path} alt={data.name} />
            <h1>{x}</h1>
            <h1>{y}</h1>
        </div>
    )
}

export default Modal;
